import React from "react";
import styled from "styled-components";

const arr = [
  "예비사업자",
  "1년 이내",
  "1~3년",
  "3년~5년",
  "5년~7년",
  "7년 이상",
];
const Wrapper = styled.div`
  display: grid;
`;
function HistorySelect() {
  return <Wrapper></Wrapper>;
}

export default HistorySelect;
